import React, { useState } from "react";
import { AppBar, Typography,  CssBaseline} from "@mui/material";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import ReactGA from "react-ga4";
import HomePage from "./HomePage";
import Create from "./Create";
import Room from "./Room";
import "../css/Main.scss";



// Initialize Google Analytics if key exists
const key = process.env.REACT_APP_ANALYTICS_KEY;
if (key) ReactGA.initialize(key);

const Main = () => {
  const [username, setUsername] = useState("");

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />

      {/* AppBar */}
      <AppBar position="static" className="menu">
        <Typography variant="h5" component="div" sx={{ p: 1 }}>
          <a href="/" style={{ textDecoration: "none", color: "inherit" }}>
            Hangmanonline.io
          </a>
        </Typography>
      </AppBar>

      <div className="container">
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<HomePage />} />

            {/* Username + Settings Page */}
            <Route
              path="/create"
              element={<Create user={username} setUser={setUsername} />}
            />
            <Route path="/:roomID" element={<Room username={username} />} />
          </Routes>
        </BrowserRouter>
      </div>
    </ThemeProvider>
  );
};

export default Main;
